import React from "react";
import {Link} from "react-router-dom";
import "./header.css";

export const Header = () => {
    return (

        <div className="header">
            <div className="logout">
                <Link to="/login">
                    <img className="logout"
                         src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQbqvgrV-qhJAwn7RCFYLq4DxnNIQoss1GeQcNi6YrRGZbvyklW&usqp=CAU"
                         alt="logout"/>
                </Link>
            </div>
            <h1><img className="logo" src="https://www.homesteadletters.com/wp-content/uploads/2010/07/yck7BoXcE.jpeg"
                     alt=""/></h1>
        </div>
    )
};
